// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css'; // Importa Bootstrap
import './css/auth.css'; // Importa tus archivos CSS (ajusta según sea necesario)
import './css/conserjeMainStyles.css'; // Importa el CSS de ConserjeMain
import Auth from './components/Auth'; // Ruta al componente Auth
import ConserjeMain from './components/ConserjeMain'; // Ruta al nuevo componente

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/auth" element={<Auth />} />
                <Route path="/conserje" element={<ConserjeMain />} /> {/* Nueva ruta para ConserjeMain */}
                {/* Otras rutas pueden ir aquí */}
            </Routes>
        </Router>
    );
};

export default App;
